column36:
A consistent message, with common terms, repeated over a long period of time produces change--regardless of wherher the message is true or change good.

With this knowledge, I propose we begin seeing clearly and calling things as they are...

Mask--forced medical device used for social conditioning; 

Social distance--disruptive scheme to create division and unrest--erodes the desire to fight for a common cause and what is inherently good;

Sanitize--apply fluid that kills natural immunity;

Testing-- process that builds statistical justification for the agenda to continue;

Contact tracing-- permission for nefarious people to capture your personal data, medical information and bodily fluids for future exploits; 

Isolation and quarantine--the slow death of independence and economic viability that necessitates a larger marxist government;

New normal--marxism wherein the few, who purport to care, and believe they are smarter than you, take more power, money and control over you, me, our families and ultimately destroy the republic.

I am wrong a lot. But I am not wrong about this.
